import './BoutiqueMenu.css'

export default function BoutiqueMenu() {

  const [toggle, setToggleMenu] = useState(false); 
  return (

      <div className="container-boutique-menu">
        <div className="item">Bonnet</div>
        <div className="item">Tour de cou</div>
        <div className="item">Pull</div>
        <div className="item">Gant</div>
        <div className="item">Chaussette</div>
        <div className="item">Plaide</div>
        <div className="item">Pelote</div>
      </div>

  );
}
